0光触媒で抗菌＆強力消臭！エアコンの空気をキレイにして、車内のイヤなニオイもとる。自動車用としては世界初の光触媒を採用したエアコンフィルター。光触媒（二酸化チタン）は光のエネルギーを使って働く触媒です。光エネルギーを化学エネルギーに変換したり、環境を汚染する物質や悪臭の除去、汚れの防止などに使われています。 <br>【特徴と効能】●光触媒で強力消臭 ●抗菌性も抜群 ●花粉・チリ・ホコリを強力除去 ●フィルター水洗いOK ●メンテナンス＆リサイクル可能 ※純正でフィルター未装着車は、別途カーディーラーでフィルター取付用のエバポリッド（フタ）をお求めください。ディーラーオプションで装着された方は、そのまま装着可能です。<br>【納期】お取り寄せ商品のため通常3～4日でのお届けとなります。(日・祝日は除く)万が一欠品の場合は別途メールにてご連絡差し上げます。お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。 <br>対応車種：01/04-05/05 RF3/RF4/RF5/RF6/RF7/RF8 ステップワゴン <br>　車検対応品<br>カーケア/カーケアその他<tr><td colspan="2">
